let text = " GG ";

function getContestData(){
  fetch('https://kontests.net/api/v1/all')
  .then((res) => res.json())
  .then((data) => {
    console.log(data);
    data.forEach(element => {
      text += `
      <div>
      <h5> ${element.name} </h5>
      </div>
      `
    });
  })
}

function App() {
  console.log(text);
  getContestData();
  console.log(text);
  return text;
}

export default App;
